import React, { useState, useEffect } from 'react';
import { FaPlus, FaEdit, FaTrash, FaList } from 'react-icons/fa';
import Layout from '../components/layout/Layout';
import PageHeader from '../components/common/PageHeader';
import { categoryApi } from '../services/api';

const Categories = () => {
  const [categories, setCategories] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchCategories();
  }, []);

  const fetchCategories = async () => {
    try {
      const response = await categoryApi.getAll();
      setCategories(response.data?.data || []);
    } catch (error) {
      setError('Failed to fetch categories');
      console.error('Error fetching categories:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <Layout>
        <div className="flex items-center justify-center min-h-screen">
          <div className="loading-spinner" />
        </div>
      </Layout>
    );
  }

  if (error) {
    return (
      <Layout>
        <div className="p-4">
          <div className="bg-red-50 text-red-700 p-4 rounded-lg">
            {error}
          </div>
        </div>
      </Layout>
    );
  }

  return (
    <Layout>
      <PageHeader
        title="Categories"
        description="Manage your safari package categories"
        actions={
          <button className="btn btn-primary">
            <FaPlus className="h-4 w-4 mr-2" />
            Add Category
          </button>
        }
      />

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {categories.map((category) => (
          <div key={category.id} className="card">
            <div className="card-body">
              <div className="flex items-center justify-between mb-4">
                <div className="flex items-center">
                  <div className="bg-indigo-100 p-3 rounded-lg mr-4">
                    <FaList className="h-6 w-6 text-indigo-600" />
                  </div>
                  <div>
                    <h3 className="font-semibold text-lg">{category.name}</h3>
                    <p className="text-sm text-gray-500">
                      {category.packages_count || 0} Packages
                    </p>
                  </div>
                </div>
                <div className="flex space-x-2">
                  <button className="btn btn-sm btn-secondary">
                    <FaEdit className="h-4 w-4" />
                  </button>
                  <button className="btn btn-sm btn-danger">
                    <FaTrash className="h-4 w-4" />
                  </button>
                </div>
              </div>
              {category.description && (
                <p className="text-gray-600 text-sm">
                  {category.description}
                </p>
              )}
            </div>
          </div>
        ))}

        {categories.length === 0 && (
          <div className="col-span-full">
            <div className="text-center py-12 bg-white rounded-lg border-2 border-dashed border-gray-300">
              <FaList className="mx-auto h-12 w-12 text-gray-400" />
              <h3 className="mt-2 text-sm font-medium text-gray-900">No categories</h3>
              <p className="mt-1 text-sm text-gray-500">Get started by creating a new category.</p>
              <div className="mt-6">
                <button className="btn btn-primary">
                  <FaPlus className="h-4 w-4 mr-2" />
                  Add Category
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </Layout>
  );
};

export default Categories;
